import React from 'react';
import './header.css'
import {
  MDBBtn,
  MDBNavbarLink,
} from 'mdb-react-ui-kit';

export default function Header() {

  return (
    <header>

      <div
        id='intro-example'
        className='p-5 text-center bg-image'
        // style={{ backgroundImage: "url('https://images.squarespace-cdn.com/content/v1/630f6f1e9677196e0a55d0f9/dc0b277c-ef52-4867-a054-032db35b033e/Light+Objects+2.jpg?format=2500w')",   height: 500}}
        style={{ backgroundImage: "url('https://images.unsplash.com/photo-1471086569966-db3eebc25a59?ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8fA%3D%3D&auto=format&fit=crop&w=2940&q=80x')",   height: 500}}
        // style={{ backgroundImage: "url('https://images.unsplash.com/photo-1466781783364-36c955e42a7f?ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8fA%3D%3D&auto=format&fit=crop&w=2942&q=80')",   height: 500}}
        // style={{ backgroundImage: "url('/images/moonbg.png')",   height: 500}}

      >
        <div className='mask'>
          <div className='d-flex justify-content-center align-items-center h-100'>
            <div className='text-black'>
              <h1 className='mb-3'>Welcome</h1>
              <h3>We offer the highest level of services to our clients</h3>
              <h5 className='mb-4'>Browse our services and make an appointment today</h5>
              <MDBNavbarLink >
              <MDBBtn
                outline rounded className='mx-2 custom-hover' color='dark'
                href='services'

              >
                Services
              </MDBBtn>
              <MDBBtn
                outline rounded className='mx-2 custom-hover' color='dark'
                href='contacts'
              >
                Contact
              </MDBBtn>
              </MDBNavbarLink>

              <MDBIcon fab icon='cc-visa' size='2x' style={{ color: 'black' }} />
              <MDBIcon fab icon='cc-mastercard' size='2x' style={{ color: 'black' }} />
            </div>
          </div>
        </div>
      </div>
    </header>
  );
}
